// import Login from "../pages/login/Login";
import Register from "../pages/register/Register";
import "./App.scss";
import Login from "../pages/login/Login";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React from "react";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
};

export default App;
